            WriteLiteral(@">

            <p>
                <strong>Acil Servis</strong><br>
                Hastanemizin acil servis hizmetleri, Acil Servis Bölümü tarafından yürütülmektedir. Modern cihazlarla donatılmış acil servisimiz deneyimli ve dinamik kadrosu ile 24 saat kesintisiz hizmet vermektedir. Acil Servis doktorlarımız, hastayı değerlendirerek ilk müdahalelerine yönelik tüm tetkik ve tedavi işlemlerini uyguladıktan sonra şikayete göre ilgili branşa yönlendirmesini yapmaktadır. Hastanemizde hizmet veren tüm branşlar tarafından acil servisimiz desteklenmektedir. Modern tıbbi cihazlar ile donatılmış olan acil servisimizde 6 yataklı gözlem odası, 1 enjeksiyon odası, 1 alçı ve pansuman odası, 1 acil müdahale (CPR) odası, 1 acil muayene odası, 1 septik müdahale odası bulunmaktadır. EKG ,defibrilator, monitör, standart donanımları olup, tam donanımlı ve kullanıma hazır ambulansımız bulunmaktadır. Acil servisimizin kolay erişilebilir bir konumda olması her branştan acil hastayı kolaylıkla kabul ve tedavi etme olanağı sağla");
            WriteLiteral("maktadır.\r\n            </p>\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n");
